schema:
{
 "description": "KeycloakAuthFlowSpec defines the desired state of KeycloakAuthFlow",
 "properties": {
  "alias": {
   "description": "Alias is display name for authentication flow",
   "type": "string"
  },
  "authenticationExecutions": {
   "items": {
    "description": "AuthenticationExecution defines keycloak authentication execution",
    "properties": {
     "alias": {
      "type": "string"
     },
     "authenticator": {
      "type": "string"
     },
     "authenticatorConfig": {
      "nullable": true,
      "properties": {
       "alias": {
        "type": "string"
       },
       "config": {
        "additionalProperties": {
         "type": "string"
        },
        "nullable": true,
        "type": "object"
       }
      },
      "type": "object"
     },
     "authenticatorFlow": {
      "type": "boolean"
     },
     "priority": {
      "type": "integer"
     },
     "requirement": {
      "type": "string"
     }
    },
    "type": "object"
   },
   "nullable": true,
   "type": "array"
  },
  "builtIn": {
   "type": "boolean"
  },
  "childType": {
   "description": "ChildType is type for auth flow if it has a parent, available options: basic-flow, form-flow",
   "type": "string"
  },
  "description": {
   "type": "string"
  },
  "parentName": {
   "type": "string"
  },
  "providerId": {
   "description": "ProviderID for root auth flow and provider for child auth flows",
   "type": "string"
  },
  "realm": {
   "description": "Realm is name of keycloak realm",
   "type": "string"
  },
  "topLevel": {
   "type": "boolean"
  }
 },
 "required": [
  "alias",
  "builtIn",
  "providerId",
  "realm",
  "topLevel"
 ],
 "title": "Keycloak Auth Flow",
 "type": "object"
}
